import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faList, faCalendar } from '@fortawesome/free-solid-svg-icons';

const MenuTabs = withStyles(() => ({
  indicator: {
    backgroundColor: '#bac866',
  },
}))(Tabs);

const MenuTab = withStyles(() => ({
  wrapper: {
    textTransform: 'none',
    fontFamily: 'Roboto Slab',
    fontWeight: 600,
    fontSize: 16,
  },
}))(Tab);

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}>
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}

export default function Bookings() {
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  return (
    <div className="inner_page p-0">
      <div className="inner_head p-3 border-bottom">
        <div className="row m-0 justify-content-between">
          <h3 className="border-0 mb-2 p-0">My Bookings List</h3>
          <button type="button" className="btn btn-theme min-btn mb-2 mb-sm-0">
            <FontAwesomeIcon icon={faList} />
            <span className="pl-2">New Booking</span>
          </button>

          <button type="button" className="btn btn-theme min-btn mb-2 mb-sm-0">
            <FontAwesomeIcon icon={faCalendar} />
            <span className="pl-2">View Calender</span>
          </button>
          <button type="button" className="btn btn-theme min-btn mb-2 mb-sm-0">
            <FontAwesomeIcon icon={faList} />
            <span className="pl-2">View List</span>
          </button>
        </div>
      </div>
      <div>
        <MenuTabs
          indicatorColor="primary"
          scrollButtons="on"
          value={value}
          onChange={handleChange}
          aria-label="simple tabs">
          <MenuTab label="Pending" {...a11yProps(0)} />
          <MenuTab label="Confirmed" {...a11yProps(1)} />
          <MenuTab label="Completed" {...a11yProps(2)} />
          <MenuTab label="Cancelled" {...a11yProps(3)} />
        </MenuTabs>
        <TabPanel value={value} index={0}>
          Pending
        </TabPanel>
        <TabPanel value={value} index={1}>
          Confirmed
        </TabPanel>
        <TabPanel value={value} index={2}>
          Completed
        </TabPanel>
        <TabPanel value={value} index={3}>
          Cancelled
        </TabPanel>
      </div>
    </div>
  );
}
